import React from 'react'

function SearchExercise({
  searchExercise,
  setSearchExercise
}){
  return(
    <input 
    placeholder="Buscar ejercicio"
    value={searchExercise}
    onChange={(eventSearch)=>{
      setSearchExercise(eventSearch.target.value)
    }} 
    ></input>
  )
}
export {SearchExercise}

const styleList = {
  background: 'green',
    width: '160px',
    textAlign: 'center',
    height: '40px',
    display: 'flex',
    alignItems: 'center',
    borderRadius: '20px',
    color: 'white',
    margin: '20px',
}

const styleInput ={
  display: 'flex',
  justifyContent: 'center'
}

function TodoItem(props){ // Creando un complemento que por dentro lleva los elementos que se mostraran en el navegador y se podran reutilizar si es necesario
    return(
      <div style={styleList}>
        <input
        style={styleInput} 
        id="input-exercise" 
        type="checkbox" 
        name="exercise"
        onClick={props.onCompleted}
        >
        </input>
        {/* <label
        htmlFor='input-exercise'
        >{props.text}</label> */}
        {/* <button>Deleted</button> agregar un boton para eliminarlo de la lista */}
      </div>
    )
}
export {TodoItem} // Todos los componenetes se deben exportar al finalizarlo y una buena practica para no exportarlo por default lo hacemos con la sintaxis de un objeto
